Architect uses Handlebars to render all templates in a repository. Basically any file is a potential template and will be processed. Files that are explicitly marked as Handlebars templates by their extension are not rendered, only copied. This behavior (and the extension) can be configured in the .architect.json file. Additionally, every file name is a potential Handlebars template. That means you can specify the curled braces in file names to dynamically create them using your user-specific values. Example: Template: {{app.name}}.rs Context: { "app": { "name": "my_app" }
} Result: my_app.rs It works the same way with directory names, but there you have the added benefit to potentially create multiple levels of subdirectories. Should a path you create this way leave the target directory the template will be ignored. Example: Template: {{package src.package}} Context: { "src": { "package": "io.v47" }
} Result: io/v47

